import React from 'react';
import { Container } from 'react-bootstrap';

const RadaMiasta = () => {
  return (
    <Container>
      <h1>Rada Miasta</h1>
      <p>Informacje o Radzie Warszawy.</p>
    </Container>
  );
};

export default RadaMiasta;
